import React from 'react';
import webimg from './img/pic.jpg';

const Home = () => {


    return (
        <>

            <section id="header" className="">
                <div className="container">
                    <div className="head_txt">
                        <h1>Grow Your Self With <strong className="brand">ASzEn</strong></h1>
                        <h4>We Are Team Of Building Future</h4>
                        <div className="btn">
                            <button href="/" className="main-btn"> Get Started</button>
                        </div>
                    </div>
                    <div className="header-img">
                        <img src={webimg} className="img-fluid animated" alt="images" />
                    </div>
                </div>
            </section>
        </>
    );
}

export default Home;
